import numpy as np

"""# using linalg (Linear Algebra) method"""

def fit_linear_reg(X,y):

  #adding a column of ones in X matrix which will represent the intercept coeffecient
  X_b = np.c_[np.ones((X.shape[0],1)),X]

  #now using equation Y = [X^T X]^-1 X^Ty
  Y = np.linalg.inv(X_b.T @ X_b) @ X_b.T @ y

  #now at last predicting the slope and intercept
  # as we know for linear regression y= c + mx

  intercept = Y[0]
  slope = Y[1]

  return intercept, slope

"""![image.png](data:image/png;base64,)

![image.png](data:image/png;base64,)

![image.png](data:image/png;base64,)
"""

X = np.array([[1],[2],[11],[6]])
y = np.array([6,32,56,21])

print(fit_linear_reg(X,y))

"""## Predict the new values

# y = c + mX
# y = intercept + slope x X
"""

def predict(X, intercept, slope):
  return intercept + (slope*X)

"""#New Values Array Initialization




"""

X_new = np.array([[21],[43],[98]])
y_new = np.array([32,1,0.9])

"""#Fitting New Values"""

intercept, slope = fit_linear_reg(X_new,y_new)

"""#New Predictions Displayed"""

print(predict(X_new,intercept, slope ))

"""#Genrating Random X and y and applying .fit()

#There must exist Linear Relationship between X_rand and y_rand in order to satisfy linearity assumption for LinearRegression Model
"""

X_rand = np.random.rand(100,1).reshape(-1,1)*100 #100 samples but 1 column
y_rand = 5 + 0.5 * X_rand + np.random.randn(100,1) * 10  # Adding linearity with noise

X_rand[:5]

y_rand[:5]

intercept, slope = fit_linear_reg(X_rand,y_rand)

"""#Prediction upon new arrays"""

X_new_plot = np.linspace(0,100,100).reshape(-1,1) #in the range between 0 to 10 genrate 100 random values
#reshape done to convert it into 2D array
X_new_plot[:5]

y_new_plot = predict(X_new_plot, intercept, slope)

y_new_plot[:5]

import matplotlib.pyplot as plt

plt.scatter(X_rand,y_rand, label='Random Data')
plt.plot(X_new_plot,y_new_plot,color = 'red', linewidth = 2, label = 'Linear Regression')
plt.xlabel('X')
plt.ylabel('y')
plt.legend()
plt.show()

